import styled from "styled-components";

export default styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 250px;
  width: 140px;
  background-color: white;
  color: #fff;
  margin: 0 15px;
  font-size: 4em;
  color:black;
  box-shadow: 0 5px 10px rgba(0, 0, 0, 0.3);
  border-radius: 12px;
`;
